SEASON 1. EPISODE 14. Mellowbrook Drift / Gift of Wacky!
Original air date June 21, 2010.

Mellowbrook Drift: Kick challenges a physics-obsessed street racing crew, led by bullying nerd Ronaldo in a winner-takes-all race on Mt. Hurtsmore which pits the laws of physics against the &quot;laws of awesome&quot;. To defeat the competition, Kick and Gunther turn to school woodshop teacher One-Eyed Jackson for help.

